import React from "react";





function Zillow(){
  fetch("https://zillowdimashirokovv1.p.rapidapi.com/GetSearchResults.htm", {
    method: "POST",
    headers: {
      "x-rapidapi-host": "ZillowdimashirokovV1.p.rapidapi.com",
      "x-rapidapi-key": "41f3f91b13mshaa0652a8c3b96f1p165abcjsn42e270cab71c",
      "content-type": "application/x-www-form-urlencoded",
    },
    body: {
      rentZestimate: [true, false],
      "zws-id": ZWSID,
    },
  })
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      console.log(err);
    });
}

export default Zillow
